-- Converted from MySQL dumps for legacy EZ Cycle Ramp data

CREATE TABLE IF NOT EXISTS "products" (
  "product_id" integer NOT NULL,
  "product_name" varchar(100) NOT NULL,
  "product_short_name" varchar(20) NOT NULL,
  "category_id" integer NOT NULL,
  "description" text,
  "description2" text,
  "description3" text,
  "description4" text,
  "description5" text,
  "description6" text,
  "image" varchar(255) DEFAULT NULL,
  "price" numeric(10,2) NOT NULL,
  "feature" text,
  "feature2" text,
  "feature3" text,
  "feature4" text,
  "feature5" text,
  "imperial_length" varchar(11) DEFAULT NULL,
  "imperial_weight" varchar(11) DEFAULT NULL,
  "imperial_height" varchar(11) DEFAULT NULL,
  "imperial_wheelbase" varchar(11) DEFAULT NULL,
  "imperial_payload" varchar(11) DEFAULT NULL,
  "metric_length" varchar(11) DEFAULT NULL,
  "metric_weight" varchar(11) DEFAULT NULL,
  "metric_height" varchar(11) DEFAULT NULL,
  "metric_wheelbase" varchar(11) DEFAULT NULL,
  "metric_payload" varchar(11) DEFAULT NULL,
  "measurement_note" text,
  "installation_pdf" varchar(100) NOT NULL,
  "stock" integer NOT NULL,
  "status" integer NOT NULL
);



CREATE TABLE IF NOT EXISTS "measurements" (
  "id" integer NOT NULL,
  "first_name" varchar(50) NOT NULL,
  "last_name" varchar(50) NOT NULL,
  "email" varchar(100) NOT NULL,
  "phone" varchar(20) NOT NULL,
  "customer_status" varchar(20) DEFAULT 'Inquiry',
  "status_date" timestamptz DEFAULT now(),
  "cargo_vehicle_make" varchar(50) DEFAULT NULL,
  "cargo_vehicle_model" varchar(50) DEFAULT NULL,
  "cargo_vehicle_year" integer DEFAULT NULL,
  "cargo_area_bed_length" integer DEFAULT NULL,
  "cargo_area_total_length" integer DEFAULT NULL,
  "cargo_area_height" integer DEFAULT NULL,
  "motorcycle_make" varchar(50) DEFAULT NULL,
  "motorcycle_model" varchar(50) DEFAULT NULL,
  "motorcycle_year" integer DEFAULT NULL,
  "motorcycle_wheelbase" integer DEFAULT NULL,
  "motorcycle_total_length" integer DEFAULT NULL,
  "motorcycle_weight" integer DEFAULT NULL,
  "message" text,
  "city" varchar(50) NOT NULL,
  "state" char(2) NOT NULL,
  "zip_code" char(5) NOT NULL,
  "ramp_type" char(7) DEFAULT NULL,
  "assembly_option" varchar(30) DEFAULT NULL,
  "delivery_option" varchar(12) DEFAULT NULL,
  "installation_option" char(9) DEFAULT NULL,
  "turnbuckles" integer DEFAULT NULL,
  "created_at" timestamptz NULL DEFAULT now()
);







