al accessory) is available to guide the rear tire onto the ramp safely. The ramp raises the bike only 2 1/2\" off the surface of the cargo bed, allowing it to be used with vans with low overheads. Compared to other models on the market, its improved COG (center of gravity) makes it a safe and reliable choice for motorcycle loading and unloading. Try our automated motorcycle loading ramp today and experience the ultimate convenience of motorcycle loading and unloading!', 'images/AUN250.png', 3650.00, 'Durable anodized black rails are lightweight, strong, and corrosion-resistant for long-lasting use.', '\"Power Tilt\" hydraulic cylinders slide motorcycles out past the bed and quickly down to the ground.', 'Computer-designed wheel chock adapts to most tire widths and diameters, ensuring a secure and stable loading experience.', 'Versatile framework easily installs in trucks, vans, and other cargo vehicles, providing effortless motorcycle loading and unloading.', 'Various supplementary accessories are available to enhance and expand the features of the ramps.', '98 in', '243 lb', '35 in *', '79 in', '1212 lb', '2500 mm', '110 kg', '900 mm *', '2000 mm', '550 kg', '* With the standard AC001 extender, the max loading height can be \n		increased to 1300 mm (51 in). With a longer AC001 extension, it can be increased to 1500 mm (59 in).', '', 50, 1),
