(31, 'John', 'OMalley', 'jomalley2019@gmail.com', '(207) 615-6422', '', '0000-00-00 00:00:00', 'Chevy', '2500', 2020, 79, 102, 38, 'Harley Davidson', 'FLTRS', 2017, 64, 96, 860, 'Hi Sandy,\r\n   Thanks for your help today below are some of my concerns.\r\n1. Front wheel of bike is a wide 180/50/21- same width as a normal rear wheel on similar bikes\r\n2. Front fender is a wrap around style, so the rear of the fender is only three  inches off the ground. Concerned that the cradle will hit when up.\r\n3. My final concern is attaching the bike to the ramp, as there is are not alot of frame points still available due to body moldings.\r\n\r\nThanks again and always feel free to call me with thoughts.  We just found your ramps and think their might be a market up here in Maine.  Look us up on Google and Facebook - Custom Hawg Motorcycle Shop.  We are a small private shop, we do everything from custom builds to oil and tires, just me and Nate the owner.  We\'ve been around since 1997.\r\nThanks,\r\nJohn\r\ncell - 207-615-6422\r\nShop - 207-219-8404', '', '', '', '0', '', '0', '0', 0, '2023-04-05 18:31:03'),
