(33, 'Roger', 'Hitt', 'rogerhitt@yahoo.com', '(806) 789-0256', '', '0000-00-00 00:00:00', 'Jeep', 'Gladiator ', 2021, 60, 82, 35, 'Harley Davidson', 'Road King', 2002, 64, 94, 775, 'The prices definitely went up since January ', '', '', '', '0', '', '0', '0', 0, '2023-04-05 22:25:04'),
