(475, 'Greg', 'Bailey', 'glbailey62@gmail.com', '(617) 271-0147', 'Inquiry', '2024-04-17 07:52:56', 'GMC', 'Elevation ', 2022, 70, 96, 33, 'Harley Davidson', 'Street Glide', 2023, 64, 95, 830, 'I have a roll top cover I would like to leave on the truck while ramp is in use.  From the back of the truck bed to the end of the roll top is 10”.  I also have a MultiPro tailgate and need to be sure I’m not applying too much weight to the back of the tailgate. My ideal situation would be to slide the ramp 6” from the back of the truck.  Total length of ramp perhaps 5’6”.  I’ve measured the location of the tie downs and it measures 5.5” from the back wall.  Looking to purchase the AC012 along with the ANU 250. Appreciate any advice. \r\nThanks In Advance,\r\nGreg Bailey', '', '', '', '0', '', '0', '0', 0, '2024-04-17 14:52:56'),
